import React, { useState } from "react";
import About from "./components/About";
import Header from "./components/Header";
import Nav from "./components/Nav";

function App() {
  return (
    //make a div styled with tailwind
    <div>
      <main>
        <Header></Header>
        <Nav></Nav>
        <About></About>
      </main>
    </div>
  );
}

export default App;
